description:
Jailhouse Heat 3D (Jake Westwood, Digital Playground / 1080p / 2009)

For the first time ever from Digital Playground, using the same epic camera technique as &quot;Avatar&quot;, comes 3D filmmaking like you've never experienced before. Get inside the mind of an obsessed, jilted lover who creates a lusty adult film to deal with his erupting sexual needs and fantasies of kinky prison sex. With an all-star cast including Jenna Haze and Jayden Jaymes, Jailhouse Heat 3D, combines comedic sexploitation with perverted pleasures.

Alyssa Reece, Anthony Rosano, Evan Stone, Jayden Jaymes, Jenna Haze, Kenzi Marie, Kianna Dior, London Keyes, Madison Parker, Manuel Ferrara, Marco Banderas, Nick Manning, Ruby Victoria, Sienna West, Tommy Gunn

Feature, 3D

